const type="ABOUT_CONTENT_DATA_SUCCESS"
export function aboutContentDataSuccess(aboutContent) {
    return {
        type: type,
        payload: aboutContent
    }
}

export const aboutContentData = (url) => dispatch => {
    fetch(url)
        .then(
            response => {
                if (!response.ok) {
                    throw new Error(response.statusText)
                }
                return response
            })
        .then(response => response.json())
        .then(aboutContent => dispatch(aboutContentDataSuccess(aboutContent)))
}
